import React, { useEffect, useState } from 'react';
import axios from 'axios';
import {
  Container,
  Paper,
  Typography,
  Table,
  TableHead,
  TableRow,
  TableCell,
  TableBody,
} from '@mui/material';

const EmployeeList = () => {
  const [employees, setEmployees] = useState([]);
  const [departments, setDepartments] = useState([]);
  const [assetCounts, setAssetCounts] = useState({});

  // Загружаем данные сотрудников и отделов
  useEffect(() => {
    const fetchData = async () => {
      try {
        const empsRes = await axios.get('http://localhost:5000/api/employees');
        const depsRes = await axios.get('http://localhost:5000/api/departments');

        setEmployees(empsRes.data);
        setDepartments(depsRes.data);
      } catch (err) {
        console.error('Ошибка загрузки сотрудников:', err);
      }
    };

    fetchData();
  }, []);

  // Подсчитываем оборудование для каждого сотрудника
  useEffect(() => {
    const fetchAssetCounts = async () => {
      const counts = {};
      for (let emp of employees) {
        try {
          const assetRes = await axios.get(`http://localhost:5000/api/assets?responsible_person=${emp.name}`);
          counts[emp.id] = assetRes.data.length;
        } catch (err) {
          console.error(`Ошибка при загрузке оборудования для ${emp.name}:`, err);
          counts[emp.id] = 0;
        }
      }
      setAssetCounts(counts);
    };

    if (employees.length > 0) {
      fetchAssetCounts();
    }
  }, [employees]);

  return (
    <Container maxWidth="md">
      <Paper elevation={3} style={{ padding: '20px', marginTop: '20px' }}>
        <Typography variant="h5" gutterBottom>
          Сотрудники
        </Typography>

        <Table size="small">
          <TableHead>
            <TableRow>
              <TableCell>Фамилия</TableCell>
              <TableCell>Имя</TableCell>
              <TableCell>Отчество</TableCell>
              <TableCell>Должность</TableCell>
              <TableCell>Отдел</TableCell>
              <TableCell>Помещение</TableCell>
              <TableCell>Вн. телефон</TableCell>
              <TableCell align="right">Оборудования</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {employees.map(emp => {
              // Разбиваем name на фронтенде
              const fullName = emp.name.split(' ');
              const surname = fullName[0] || '';
              const name = fullName[1] || '';
              const patronymic = fullName[2] || '';

              // Находим отдел
              const dept = departments.find(d => d.id === emp.department_id);

              return (
                <TableRow key={emp.id}>
                  <TableCell>{surname}</TableCell>
                  <TableCell>{name}</TableCell>
                  <TableCell>{patronymic || '-'}</TableCell>
                  <TableCell>-</TableCell>
                  <TableCell>{dept?.name || 'Не указано'}</TableCell>
                  <TableCell>{emp.room || '-'}</TableCell>
                  <TableCell>{emp.internal_phone || '-'}</TableCell>
                  <TableCell align="right">{assetCounts[emp.id] || 0}</TableCell>
                </TableRow>
              );
            })}
          </TableBody>
        </Table>
      </Paper>
    </Container>
  );
};

export default EmployeeList;
